import React from "react";

function HomePage() {
  return (
    <div className="HomePage">
      <h1>Welcome to Your Shopping List App!</h1>
      <p>
        This app helps you manage your shopping lists efficiently. You can
        create multiple lists, add items to them, mark items as bought, and
        more.
      </p>
      <p>
        Get started by <a href="/lists">viewing your lists</a> or{" "}
        <a href="/create-list">creating a new list</a>.
      </p>
      {/* Other introductory information or navigation elements */}
    </div>
  );
}

export default HomePage;
